ronww1_news.67.d코0=Today The Armistice of Mudros has ended the conflict between the Ottoman Empire and the Allies of World War I, with the armistice it has granted independence to the Mutawakkilite Kingdom of Yemen. it seems like the world war is coming to a end
ronww1_news.67.a코0=The war is over
ronww1_news.68.t코0=Austria-Hungary enters an armistice with the Allies
ronww1_news.68.d코0=The Austria-Hungarian empire has entered an armistice with the Allies, at the Villa Giusti in Padua. It seems like another empire will collapse as many of the territories prepare to declare independence as spurs of nationalism go through the empire. It seems like Europe is taking a newer shape from how it started
ronww1_news.68.a코0=The war is finally over
ronww1_news.69.t코0=The Belgian royal family returns to Brussels
ronww1_news.69.d코0=Today The Belgian royal family returns to Brussels after the war comes to a end, King Albert I having commanded the Allied Army group in the autumn Courtrai offensive, which liberated his country. It seems like things are returning to normal for the kingdoms of Belgium
ronww1_news.69.a코0=A return to normalcy
ronww1_news.70.t코0=Darwin Rebellion
ronww1_news.70.d코0=Today the Darwin Rebellion took place in Australia: Disaffected workers march on Government House, Darwin, demanding the resignation of the Administrator of the Northern Territory, John A. Gilruth. It is unclear how the stability of the country country will be affected and if the leader will be ousted
ronww1_news.70.a코0=The rebels will rise
ronww1_news.71.t코0=Greater Poland Uprising
ronww1_news.71.d코0=Poles in Greater Poland have risen up against the Germans, ignited by a patriotic speech made in Poznań by pianist and politician Ignacy Jan Paderewski. It seems like the polish war for its independence. Poland is expected to become a new nation and may even rise to become a great power.
ronww1_news.71.a코0=Poland rises once more!

# No events 72-80 Because of Mikes Mistake

ronww1_news.81.t코0=Mona Lisa Stolen!
ronww1_news.81.d코0=Leonardo da Vinci’s Mona Lisa, also known as La Gioconda, is the most famous painting in the world. Quantities of effort and ink have been spent over the years on identifying who she was and deciding what her enigmatic smile signifies, what she says about femininity, if anything, and why she has no eyebrows. Leonardo took the painting with him when he was invited to France by Francis I in 1516. The king bought it and at the French Revolution it was placed in the Louvre. Napoleon took it away to hang in his bedroom, but it was returned to the Louvre afterwards.
ronww1_news.81.a코1=It was stolen to avenge Italy...
ronww1_news.82.t코0=First Passenger Flight
ronww1_news.82.d코0=Landing in Düsseldorf after a nine hour flight, the zepplin LZ7 has completed the first ever passenger flight by any aircraft.It will begin regular services this fall.
ronww1_news.82.a코1=This is the future!
ronww1_news.83.t코0=Halley's Comet flies over!
ronww1_news.83.d코0=With its last visit in 1835 few people alive will witness their second pass of Halley's comet. The comet is predicted to make a very visble and bright pass this year with its next visit due to occur in 1986.
ronww1_news.83.a코1=Until next time passing friend!
ronww1_news.84.t코0=Slavery outlawed in China
ronww1_news.84.d코0=Having been abolished in the civilised world since the 1830's, China has taken the step of banning slavery accross the country. The practice of slavery has been allowed in China since the Shang Dynasty in the 2nd century AD and many predict it will take at least a generation for the ban to take effect.
ronww1_news.84.a코1=The end of a horrible practice
ronww1_news.85.t코0=Plague hits China
ronww1_news.85.d코0=Having started out as a small outbreak in the province of Manchuria a plague has spread across China. It is not known how this plague was first contracted but it boasts a near 100% mortality rate and has affected the wider Chinese population incuding the capital Peking.
ronww1_news.85.a코1=Awful developments
ronww1_news.86.t코0=Earthquake in Kebin
ronww1_news.86.d코0=At 11PM local time a 7.7 magnitude earthquake struck Russian Turkestan. Local reports indicated that almost all of the city of Alma-Ata has been flattened along with 452 people being killed by landslides.
ronww1_news.86.a코1=Our thoughts are with them
ronww1_news.87.t코0=First freight flight
ronww1_news.87.d코0=Landing in Columbus, Ohio, at midday the worlds first air delivery occured as a wright flyer model B delivered a shipment of silk for the opening of a new store in the state capital.
ronww1_news.87.a코1=Nothing but a cheap stunt!
ronww1_news.88.t코0=Nanking exposition
ronww1_news.88.d코0=With the backing of the Quing government Nanking has begun a 4 month expostion of its industrial and cultural acheivements. Exibitions from Japan and Great Britian are also on show.
ronww1_news.88.a코1=A bright start for a new China?
ronww1_news.89.t코0=Mexico celebrates 100 years
ronww1_news.89.d코0=In the midst of a consitutional crisis between rival presidential candidates, Mexico is celebrating 100 years as a republic. Celebrations have been held in all major cities and a victory parade will be held at the presidential palace this evening.
ronww1_news.89.a코1=Good for them
ronww1_news.90.t코0=First International Aviation Meeting
ronww1_news.90.d코0=From January 10th to 20th, Aviators from all around the United States and the world met in Dominguez Field outside of Los Angeles for the first ever International Air Meeting. During this meet the world would see some interesting designs, some becomming ubiquitous in the aeronautical scene in the coming years and decades, such as the Triplane and early Monoplane prototypes. While, other ideas here would die very soon thereafter and not garnish much support such as the double biplane and the gyroplane, which will never see much use outside of experimentation. The contestants were competing for $75,000 in potential prise money, and the events taking place from 2 PM onwards averaged 20,000 specatators per day. New air speed records and altitude records were set at 55 MPH(89 KPH) and 4,164 feet(1,269m), respectively.
ronww1_news.90.a코1=Onward, Into a New Era!
ronww1_news.91.t코0=Lee de Forest Broadcast
ronww1_news.91.d코0=In 1907, it was postulated that soon famous operas and other performances could be sent out using radio wirelessly into people's homes around major cities. In 1910, on the night of January 13 this became a reality, when Lee de Forest's Radio Telephone Company finaced a large event; Wherein several microphones were set up at the stage of multiple opera performances and the sound was transmitted to several publicly available recievers for people to listen in. While the exercise has been deemed a filure, it was  not of the radio transmission but the poor quality of the microphones that led to the transmission being very poor quality.
ronww1_news.91.a코1=If this continues we might never leave our homes.
ronww1_news.92.t코0=Assassination of Boutros Ghali
ronww1_news.92.d코0=On February 21, tensions in Egypt came to a head, resulting in the assassination of Prime Minister Ghali. Accused of siding with the British during the Denshawai Incident, a young man by the name of Ibrahim Nassif al-Wardani shot the Prime Minister 5 times, landing 3. He died the next day.
ronww1_news.92.a코1=May God Rest His Soul
ronww1_news.93.t코0=Albanian Revolt
ronww1_news.93.d코0=In May of 1910, in reaction to new taxation and centralization policies from the Young Turk dominated Ottoman Government, the Albanian people have risen up in revolt. After two months of fighting the Albanian Rebels are defeated and even harsher restrictions are placed on them in addition to the revocation of the right to publish in their language.
ronww1_news.93.a코1=The Powder Keg never fails to disappoint
ronww1_news.94.t코0=End of Slavery in China
ronww1_news.94.d코0=The Emperor of China has made official that the practice of slavery, within the bounds of his Empire will not stand. Slavery is now a crime punishable by significant fine and potential imprisonment. Slavery has long played a large part of Chineese society so the future is uncertain for them but this is a step in the right direction.
ronww1_news.94.a코1=Another Victory for Freedom
ronww1_news.95.t코0=Frankenstein: The Film
ronww1_news.95.d코0=Mary Shelly's iconic Frankenstein has been adapted for the silver screen. Becoming the first horror movie, it premiers on March 18, 1910 with Charles Ogle playing the part of Frankenstein.
ronww1_news.95.a코1=This is terribly distressing!
ronww1_news.96.t코0=International Women’s Day
ronww1_news.96.d코0=International Women’s Day was first observed by Austria, Denmark, Germany, and Switzerland in 1911 on March 19th and by Russia in 1913 on the last Sunday of February. March 8th has been the recognized date for International Women’s Day since 1914.
ronww1_news.96.a코1=Get Back In The Kitchen



